import React from 'react';
import './App.css';

const Header = () => (
  <header>
    <h1>Your Name</h1>
    <p>Student at XYZ University</p>
  </header>
);

const Projects = () => (
  <section>
    <h2>Projects</h2>
    {/* Add your projects here */}
    <div className="project">
      <h3>Project Name</h3>
      <p>Description of the project.</p>
    </div>
  </section>
);

const Skills = () => (
  <section>
    <h2>Skills</h2>
    {/* Add your skills here */}
    <ul>
      <li>React</li>
      <li>JavaScript</li>
      <li>HTML/CSS</li>
    </ul>
  </section>
);

const Contact = () => (
  <section>
    <h2>Contact</h2>
    <p>Email: your.email@example.com</p>
    <p>LinkedIn: linkedin.com/in/yourusername</p>
  </section>
);

function App() {
  return (
    <div className="App">
      <Header />
      <Projects />
      <Skills />
      <Contact />
    </div>
  );
}

export default App;
